import React from "react";
import Row from "react-bootstrap/Row";
import { Col, Container, Image } from "react-bootstrap";

const Persone = () => {
  const persone = {
    id: 1,
    firstname: "Денис",
    lastname: "Колосун",
    surname: "Петрович",
    img: "15e832ed-fd36-4217-8fd2-b0c8397d7598.jpg",
    updatedAt: "2023-07-29T21:16:29.249Z",
    createdAt: "2023-07-29T21:16:29.249Z",
  };
  return (
    <Container className="mt-3">
      <Row>
        <Col md={4}>
          <Image width={300} height={300} src={persone.img} />
        </Col>
        <Col md={4}>
          <Row className="d-flex flex-column align-items-center">
            <h2>{persone.lastname}</h2>
            <h2>{persone.firstname}</h2>
            <h2>{persone.surname}</h2>
          </Row>
        </Col>
      </Row>
    </Container>
  );
};

export default Persone;
